runtime: java8
inbound_services:
- warmup
derived_file_type:
- java_precompiled
threadsafe: True
auto_id_policy: default
beta_settings:
  'source_reference': 'https://github.com/wak-nda/sacc.git#ba2811b7d46849f2c7c147b7997b98da7bf22788'
api_version: 'user_defined'
handlers:
- url: /
  script: unused
  login: optional
  secure: optional
- url: /.*/
  script: unused
  login: optional
  secure: optional
- url: /_ah/.*
  script: unused
  login: optional
  secure: optional
- url: .*\.jsp
  script: unused
  login: optional
  secure: optional
- url: /sendProximity
  script: unused
  login: optional
  secure: optional
- url: /taskqueue/sendPosition
  script: unused
  login: optional
  secure: optional

skip_files: app.yaml
